import { Link } from 'react-router-dom';
const list1 = ['index', 'notices', 'curriculum', 'case', 'symposia', 'dynamic', 'movie', 'video', 'vlog']
class LeftNav extends Component {
    render() {
        const head = this.props.attr//从父组件获得属性（attr）值，来判断在哪一个栏目（列表页）界面
        //栏目的名称（首页，通知公告；精品课程；案例分析；活动概况；强军动态；强军影视；练兵备战；创意视频）
        const list = [{name:'index',Cname:'首页'}, 'notices']
        return (
            <ul className="detail-left-ul">
                {list.map((item) => (
                    <li className={item === head ? 'awalys' : 'detail-left-li'}>
                        <Link to={`/list/${item}`}>{item}</Link>
                    </li>
                ))}
            </ul>
        )
    }
}
export default LeftNav;
